Defendant Mark W DeBaets in court, in custody, with attorney Kelsey Morin.   Timothy F. Westphal appeared for the State of Wisconsin.    Defendant enters a guilty plea to Count 1.  Court finds defendant guilty.  DEFENDANT NEEDS ID PROCESSING.

The Court Orders the Following:

Imposed Sentence of:

9 Years Imprisonment (Credit - 90 days )  CONCURRENT TO 14CM1283 and 14CM1439
- 5 Years of Initial Confinement
- 4 Years of Extended Supervision

Conditions of Extended Supervision:
- AODA Assessment and follow through with any treatment recommended from prison;
- Absolute Sobriety; Random U.A.s;
- No Use or Possession of alcohol or illegal drugs or drug paraphernalia;
- No Use or Possession of prescription drugs without a valid prescription;
- Any valid prescription drugs must be taken in the manner in which they are prescribed;
- Inform agent of all prescriptions;
- Sign Medical Release for Agent;
- Successfully complete and Anger Management class if not completed in Prison;
- Successfully complete a victim impact class if not completed in Prison;
- Obtain a Driver's License within the first 6 months of release onto ES;
- Operate a Motor Vehicle with a Valid Drivers License;
- Maintain/Obtain full time employment within 60 days of release onto ES;
- Provide DNA sample if not yet provided  and pay surcharge;
- No contact with Amanda H., Stanton M., Peter M., David and Kathy A., Andrew S. and James W..

Restitution: $2,553.19 joint and several with Andrew S.  (to be paid out of 25% of prison earnings and then once on ES to be paid at the rate of $75 per month commencing the 3rd month of release onto ES.)  Restitution to be paid before costs.  

Cost: $278.00 
DNA surcharge: $250.00
(To be paid  out of 25% of prison earnings and then once on ES to be paid at the rate of $75 per month commencing the 3rd month of release onto ES only after restitution is paid and/or  53 hours of community service to be completed by  by the completion of extended supervision.  Court must receive notice of completion prior to due date.)

Defendant is not eligible for the Challenge Incarceration Program
Defendant is eligible for the Substance Abuse Program

Felony warnings, immigration warnings,  voting rights and firearms warnings given.
